import Data from './Data'

const SuggestionBox = ({text}) => {
    const renderSuggestions = () => {
        Data.filter((a) => {
            console.log(a)
            if(a.includes(text)){
                return true
            }
        })
    }


    return (
        <>
            {renderSuggestions()}
        </>
    )
}

export default SuggestionBox
